import React from "react";

export default function Practice(props) {
  const [isShown, setIsShown] = React.useState(false);

  return (
    <div>
      {props.setup && <h3>{ props.setup }</h3>}
      <p>{ props.punchline }</p>
      <button>toggle</button>
      <hr />
    </div>
  );
}
